void PageHandlerAsyncWaiter::GetModelInfo(WebUIGetModelInfoResultPtr* out_result)
{
    base::RunLoop loop;
    proxy_->GetModelInfo(base::BindOnce(
        [](base::RunLoop* loop, WebUIGetModelInfoResultPtr* out_result, WebUIGetModelInfoResultPtr result) {
            *out_result = std::move(result);
            loop->Quit();
        },
        &loop, out_result));
    loop.Run();
}

WebUIGetModelInfoResultPtr PageHandlerAsyncWaiter::GetModelInfo()
{
    WebUIGetModelInfoResultPtr async_wait_result;
    GetModelInfo(&async_wait_result);
    return async_wait_result;
}

void PageHandlerAsyncWaiter::ClassifyHosts(const std::vector<std::string>& hosts, std::vector<std::vector<WebUITopicPtr>>* out_topics_for_hosts)
{
    base::RunLoop loop;
    proxy_->ClassifyHosts(std::move(hosts),
        base::BindOnce(
            [](base::RunLoop* loop, std::vector<std::vector<WebUITopicPtr>>* out_topics_for_hosts, std::vector<std::vector<WebUITopicPtr>> topics_for_hosts) {
                *out_topics_for_hosts = std::move(topics_for_hosts);
                loop->Quit();
            },
            &loop, out_topics_for_hosts));
    loop.Run();
}

std::vector<std::vector<WebUITopicPtr>> PageHandlerAsyncWaiter::ClassifyHosts(const std::vector<std::string>& hosts)
{
    std::vector<std::vector<WebUITopicPtr>> async_wait_result;
    ClassifyHosts(std::move(hosts), &async_wait_result);
    return async_wait_result;
}

